  return (
    <>
    <Row justify="center">
      <Col span={20}>
        <Image
          width={1000}
          src="http://localhost:3000/HR_employee.png"
        />

      </Col>
    </Row>
    <Row justify="center">

    </Row>
    <Content><h1>Mianrkhan</h1>this is content</Content>
        <Image
          width={1000}
          src="http://localhost:3000/formal.jpg"
        />
    </>
  );
};

export default Profile;
